import React from 'react'
import {Helmet} from 'react-helmet';

import CreateUser from '../../components/UserCreate/index'
import Header from '../../components/Header/index'

import './userCreate.css'


const handleSubmit = (e) => {
    e.preventDefault();

    const id = document.getElementById('documento');

    alert(id);
}

export default function CreateUserPage () {
    return(
        <>
            <Helmet>
                <title>Nuevo usuario</title>
            </Helmet>
            <Header />
            <div className="wrapper fadeInDown">
                <div id="formContent" className="nuevoUsuario">
                    <CreateUser />
                </div>
                <div className="col-12 divBoton">
                    <button className="btn btn-primary boton " type="submit"  onSubmit={handleSubmit}>Crear Usuario</button>
                </div>
            </div>
        </>
    );
}
